void Console_WriteIntWidth (INTEGER x, INTEGER n)
{
	INTEGER i, x0;
	CHAR a[10];
	if (x < 0) {
		if (x == (-2147483647-1)) {
			Console_writeStr((CHAR*)"-2147483648", (LONGINT)12);
			return;
		}
		n -= 1;
		x0 = -x;
	} else {
		x0 = x;
	}
	i = 0;
	do {
		a[__X(i, 10)] = (CHAR)((int)__MOD(x0, 10) + 48);
		x0 = __DIV(x0, 10);
		i += 1;
	} while (!(x0 == 0));
	while (n > i) {
		Console_writeCh(' ');
		n -= 1;
	}
	if (x < 0) {
		Console_writeCh('-');
	}
	do {
		i -= 1;
		Console_writeCh(a[__X(i, 10)]);
	} while (!(i == 0));
}

void Console_WriteHex (INTEGER val)
{
	INTEGER i, y;
	CHAR a[10];
	i = 0;
	do {
		y = __MASK(val, -16);
		if (y < 10) {
			a[__X(i, 10)] = (CHAR)(y + 48);
		} else {
			a[__X(i, 10)] = (CHAR)(y + 55);
		}
		val = __ASHR(val, 4);
		i += 1;
	} while (!(val == 0));
	do {
		i -= 1;
		Console_writeCh(a[__X(i, 10)]);
	} while (!(i == 0));
}


